import React, { useState } from "react";
import '../node_modules/bootstrap/dist/css/bootstrap.min.css';
import ArrowUpwardIcon from '@mui/icons-material/ArrowUpward';
import ArrowDownwardIcon from '@mui/icons-material/ArrowDownward';
import ButtonGroup from '@mui/material/ButtonGroup';
import Button from '@mui/material/Button'; 
import SportsHandballSharpIcon from '@mui/icons-material/SportsHandballSharp';
import Alert from '@mui/material/Alert';
import Stack from '@mui/material/Stack';

const App = () => {

    const [num, setNum] = useState(0);


    const drama = () => {
        setNum(num + 1);
        // alert("bakchodi na chacha");
    }

    const dramatwo = () => {
        setNum((prev) => {
            if (prev === 0) {
                <Alert icon={<SportsHandballSharpIcon fontSize="inherit" />} severity="success">
        This is a success alert â€” check it out!
      </Alert>
                return 0 ;
            }
            else {
                return prev - 1;
            }
        });
    }

    return (
        <React.Fragment>
            <div className="container container-sm ">
                <div className="second">
                    <h1 className="h1class">{num}</h1>
                    <div className="buttonkeliye">
                        <ButtonGroup

                            disableElevation
                            variant="contained"
                            aria-label="Disabled elevation buttons"
                        >
                            <Button onClick={drama}><ArrowUpwardIcon />Incre</Button>
                            <Button onClick={dramatwo}><ArrowDownwardIcon />Decre</Button>
                        </ButtonGroup>
                      

                    </div>
                </div>
            </div>
        </React.Fragment>
    )
}
export default App;
